--

CREATE PROCEDURE etl_loader.revoke_privileges(IN old_user text)
    LANGUAGE plpgsql
    AS $$
DECLARE
    obj RECORD;
	sql_text TEXT;
BEGIN
    FOR obj IN
        SELECT 
            n.nspname AS schema_name,
            c.relname AS object_name,
            c.relkind AS object_type
        FROM 
            pg_class c
        JOIN 
            pg_namespace n ON c.relnamespace = n.oid
        JOIN 
            pg_roles r ON r.oid = c.relowner
        WHERE 
            has_schema_privilege(old_user, n.oid, 'USAGE')
   	LOOP
		BEGIN
			sql_text=format('REVOKE ALL PRIVILEGES ON %I.%I FROM %I;', 
                       obj.schema_name, 
                       obj.object_name,
                       old_user);
			 RAISE NOTICE '%', sql_text;
	         EXECUTE sql_text;

		EXCEPTION WHEN OTHERS THEN
        	 RAISE NOTICE 'Error. Ignoring. % %', sql_text, SQLERRM;
		END;
    END LOOP;
	EXECUTE format('REVOKE ALL PRIVILEGES ON ALL TABLES IN SCHEMA public FROM %I;', old_user);
	EXECUTE format('REVOKE ALL PRIVILEGES ON ALL SEQUENCES IN SCHEMA public FROM %I;', old_user);
	EXECUTE format('REVOKE ALL PRIVILEGES ON ALL FUNCTIONS IN SCHEMA public FROM %I;', old_user);
	EXECUTE format('REVOKE ALL ON DATABASE egdb FROM %I;', old_user);
	EXECUTE format('DROP ROLE %I;', old_user);

END ;$$;


