er, the USACE collected and presented technical data and estimated costs, with consideration of project reliability and risk. The process used by the USACE to examine federal projects as a total system instead of as individual projects will continue to be refined over time. This technical review is an initial systems-based tool that decision makers at any level can use to make more informed judgments as they manage coastal risk reduction projects in the United States, both now and in the near future.</div>", "copyrightText": "US Army Corps of Engineers, Mobile District. Operations Division, Spatial Data Branch (CESAM-OPJ) & the Institute for Water Resources (IWR)", "spatialReference": {"wkid": 4326, "latestWkid": 4326}, "initialExtent": {"xmin": -185.79289687958075, "ymin": -123.31817863955717, "xmax": 160.67394243458082, "ymax": 180.3190915935573, "spatialReference": {"wkid": 4326, "latestWkid": 4326}}, "fullExtent": {"xmin": -170.83578572599998, "ymin": -14.334151968999947, "xmax": 145.71683128100005, "ymax": 71.33506492300006, "spatialReference": {"wkid": 4326, "latestWkid": 4326}}, "allowGeometryUpdates": true, "supportsTrueCurve": true, "supportedCurveTypes": ["esriGeometryCircularArc"], "allowTrueCurvesUpdates": true, "onlyAllowTrueCurveUpdatesByTrueCurveClients": false, "units": "esriDecimalDegrees", "supportsAppend": true, "supportsSharedDomains": true, "supportsWebHooks": true, "supportsTemporalLayers": true, "layerOverridesEnabled": true, "size": 8642560, "syncEnabled": false, "supportsApplyEditsWithGlobalIds": false, "supportsReturnDeleteResults": true, "supportsLayerOverrides": true, "supportsTilesAndBasicQueriesMode": true, "supportsQueryContingentValues": true, "supportedContingentValuesFormats": "JSON, PBF", "supportsContingentValuesJson": 2, "advancedEditingCapabilities": {"supportsSplit": false, "supportsReturnServiceEditsInSourceSR": false, "supportsAsyncApplyEdits": true, "supportsReturnEditResults": true, "supportsApplyEditsbyUploadID": true, "su