39	69	https://services7.arcgis.com/n1YM8pTrFmm7L4hs/ArcGIS/rest/services/Port_Statistical_Area/FeatureServer	2024-09-01 00:09:38.073287	INIT	{"currentVersion": 11.2, "serviceItemId": "b7fd6cec8d8c43e4a141d24170e6d82f", "serviceDescription": "Per Engineering Regulation 1130-2-520, the U.S. Army Corps of Engineers' Navigation Data Center is responsible to collect, compile, publish, and disseminate waterborne commerce statistics.  This task has subsequently been charged to the Waterborne Commerce Statistics Center to perform.  Performance of this work is in accordance with the Rivers and Harbors Appropriation Act of 1922.  Included in this work is the definition of a port area.  A port area is defined in Engineering Pamphlet 1130-2-520  as:\\n\\n(1) Port limits defined by legislative enactments of state, county, or city governments.\\n(2) The corporate limits of a municipality. \\n\\nThe primary objective of the statistical port boundary project is to utilize a GIS to prepare a USACE enterprise-wide statistical port boundary polygon feature class per EP 1130-2-520 and organized in SDSFIE 4.0.2 format. ", "hasVersionedData": false, "supportsDisconnectedEditing": false, "hasStaticData": false, "hasSharedDomains": false, "maxRecordCount": 2000, "supportedQueryFormats": "JSON", "supportsVCSProjection": false, "supportedExportFormats": "csv,shapefile,sqlite,geoPackage,filegdb,featureCollection,geojson,kml,excel", "supportedConvertFileFormats": "JSON,PBF", "supportedConvertContentFormats": "LayerEditCollection", "capabilities": "Query", "description": "<p><span style='font-size:12.0pt;'>Per\\nEngineering Regulation 1130-2-520, USACE\\u2019s NDC and WCSC are responsible for\\ncollecting, compiling, printing, and distributing all domestic waterborne\\ncommerce statistics for which the USACE has responsibility.<span>\\u00a0 </span>Per a 1998 Office of Management and Budget\\n(OMB) memorandum, the WCSC inherited the requirement to include foreign\\nwaterborne commerce formally executed by the U.S. Census Bureau.<span>\\u00a0 </span>Performance of this work is in accordance\\nwith the Rivers and Harbors Appropriation Act of 1922 (33 USC 555).</span></p>\\n\\n<p><span style='font-size:12pt;'>Engineering\\nRegulation 1130-2-520 defines a port as:</span></p>\\n\\n<p style='margin-left:.5in; text-indent:-.25in;'><span style='font-size:12.0pt;'><span>(1)<span style='font:7.0pt &quot;Times New Roman&quot;;'>\\u00a0\\u00a0 </span></span></span><span style='font-size:12.0pt;'>Port limits defined by\\nlegislative enactments of state, county, or city governments.</span></p>\\n\\n<p style='margin-left:.5in; text-indent:-.25in;'><span style='font-size:12.0pt;'><span>(2)<span style='font:7.0pt &quot;Times New Roman&quot;;'>\\u00a0\\u00a0</span></span></span><span style='font-size:12.0pt;'>The corporate limits of a\\nmunicipality.\\u00a0</span></p>\\n\\n<p><span style='font-size:12pt;'>At minimum, the feature class includes the following attribution:</span><span style='font-size:12pt;'>\\u00a0</span></p><table border='1' cellpadding='0' cellspacing='0' style='border-collapse:collapse; border:none;'><tbody><tr>\\n   <td style='width:119.7pt; border:solid windowtext 1.0pt; background:black; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='160'>\\n   <p style='text-align:center;'><span style='font-size:12.0pt;'><font color='#ffffff'>Attribute Name</font></span></p>\\n   </td>\\n   <td style='width:250.2pt; border:solid windowtext 1.0pt; border-left:none; background:black; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='334'>\\n   <p style='text-align:center;'><span style='font-size:12.0pt; color:white;'>Definition</span></p>\\n   </td>\\n   <td style='width:63.0pt; border:solid windowtext 1.0pt; border-left:none; background:black; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='84'>\\n   <p style='text-align:center;'><span style='font-size:12.0pt; color:white;'>Data Type</span></p>\\n   </td>\\n   <td style='width:45.9pt; border:solid windowtext 1.0pt; border-left:none; background:black; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='61'>\\n   <p style='text-align:center;'><span style='font-size:12.0pt; color:white;'>Length</span></p>\\n   </td>\\n  </tr></tbody><tbody><tr>\\n  <td style='width:119.7pt; border:solid windowtext 1.0pt; border-top:none; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='160'>\\n  <p><span style='font-size:12.0pt;'>featureDescription</span></p>\\n  </td>\\n  <td style='width:250.2pt; border-top:none; border-left:none; border-bottom:solid windowtext 1.0pt; border-right:solid windowtext 1.0pt; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='334'>\\n  <p><span style='font-size:12.0pt;'>The\\n  narrative describing the feature.<span>\\u00a0 </span>This\\n  attribute column will describe how the statistical port boundary was\\n  generated using GIS.<span>\\u00a0 </span>It can include\\n  the legislative description, a note that the U.S. Census Bureau municipal limit\\n  was used, or other details.</span></p>\\n  </td>\\n  <td style='width:63.0pt; border-top:none; border-left:none; border-bottom:solid windowtext 1.0pt; border-right:solid windowtext 1.0pt; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='84'>\\n  <p style='text-align:center;'><span style='font-size:12.0pt;'>String</span></p>\\n  </td>\\n  <td style='width:45.9pt; border-top:none; border-left:none; border-bottom:solid windowtext 1.0pt; border-right:solid windowtext 1.0pt; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='61'>\\n  <p style='text-align:center;'><span style='font-size:12.0pt;'>Max</span></p>\\n  </td>\\n </tr>\\n <tr>\\n  <td style='width:119.7pt; border:solid windowtext 1.0pt; border-top:none; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='160'>\\n  <p><span style='font-size:12.0pt;'>featureName</span></p>\\n  </td>\\n  <td style='width:250.2pt; border-top:none; border-left:none; border-bottom:solid windowtext 1.0pt; border-right:solid windowtext 1.0pt; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='334'>\\n  <p><span style='font-size:12.0pt;'>The\\n  common name of the feature.<span>\\u00a0 </span>This will\\n  be the port name as defined by the legislative enactment or the municipality.<span>\\u00a0 </span>Each name should include which State(s) the\\n  port is located (ex. Louisville-Jefferson County Riverport Authority, KY).</span></p>\\n  </td>\\n  <td style='width:63.0pt; border-top:none; border-left:none; border-bottom:solid windowtext 1.0pt; border-right:solid windowtext 1.0pt; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='84'>\\n  <p style='text-align:center;'><span style='font-size:12.0pt;'>String</span></p>\\n  </td>\\n  <td style='width:45.9pt; border-top:none; border-left:none; border-bottom:solid windowtext 1.0pt; border-right:solid windowtext 1.0pt; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='61'>\\n  <p style='text-align:center;'><span style='font-size:12.0pt;'>80</span></p>\\n  </td>\\n </tr>\\n <tr>\\n  <td style='width:119.7pt; border:solid windowtext 1.0pt; border-top:none; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='160'>\\n  <p><span style='font-size:12.0pt;'>installationId</span></p>\\n  </td>\\n  <td style='width:250.2pt; border-top:none; border-left:none; border-bottom:solid windowtext 1.0pt; border-right:solid windowtext 1.0pt; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='334'>\\n  <p><span style='font-size:12.0pt;'>The\\n  codes assigned by the DoD Component used to identify the site or group of\\n  sites that make up an installation. This field will remain empty, as the\\n  project focus is not on military installations.</span></p>\\n  </td>\\n  <td style='width:63.0pt; border-top:none; border-left:none; border-bottom:solid windowtext 1.0pt; border-right:solid windowtext 1.0pt; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='84'>\\n  <p style='text-align:center;'><span style='font-size:12.0pt;'>String</span></p>\\n  </td>\\n  <td style='width:45.9pt; border-top:none; border-left:none; border-bottom:solid windowtext 1.0pt; border-right:solid windowtext 1.0pt; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='61'>\\n  <p style='text-align:center;'><span style='font-size:12.0pt;'>11</span></p>\\n  </td>\\n </tr>\\n <tr>\\n  <td style='width:119.7pt; border:solid windowtext 1.0pt; border-top:none; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='160'>\\n  <p><span style='font-size:12.0pt;'>mediaId</span></p>\\n  </td>\\n  <td style='width:250.2pt; border-top:none; border-left:none; border-bottom:solid windowtext 1.0pt; border-right:solid windowtext 1.0pt; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='334'>\\n  <p><span style='font-size:12.0pt;'>Used\\n  to link the record to associated multimedia records the reference data.<span>\\u00a0 </span>The number used in this column will reference\\n  a related \\u201cmediaId\\u201d table that will store the source document for appropriate\\n  legislation or municipality limit reference.</span></p>\\n  </td>\\n  <td style='width:63.0pt; border-top:none; border-left:none; border-bottom:solid windowtext 1.0pt; border-right:solid windowtext 1.0pt; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='84'>\\n  <p style='text-align:center;'><span style='font-size:12.0pt;'>String</span></p>\\n  </td>\\n  <td style='width:45.9pt; border-top:none; border-left:none; border-bottom:solid windowtext 1.0pt; border-right:solid windowtext 1.0pt; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='61'>\\n  <p style='text-align:center;'><span style='font-size:12.0pt;'>40</span></p>\\n  </td>\\n </tr>\\n <tr>\\n  <td style='width:119.7pt; border:solid windowtext 1.0pt; border-top:none; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='160'>\\n  <p><span style='font-size:12.0pt;'>metadataId</span></p>\\n  </td>\\n  <td style='width:250.2pt; border-top:none; border-left:none; border-bottom:solid windowtext 1.0pt; border-right:solid windowtext 1.0pt; padding:0in 5.4pt 0in 5.4pt;' valign='top' width='334'>\\n  <p><span style='font-size:12.0pt;'>Used\\n  to